import React, { useState, useEffect } from 'react';
import {VerticalTimeline, VerticalTimelineElement} from 'react-vertical-timeline-component';
import SchoolIcon from '@material-ui/icons/School';
import WorkIcon from '@material-ui/icons/Work';
import StarIcon from '@material-ui/icons/Star';
import "./VerticalTimeline.css";
import "./VerticalTimelineElement.css";
const defaultVisibleTimelineElements = [
  <VerticalTimelineElement
    onTimelineElementClick={() => {
      // eslint-disable-next-line no-alert
      alert('onTimelineElementClick event fired');
    }}
    className="vertical-timeline-element--education"
    contentStyle={{ background: '#f17a7a', color: '#fff' }}
    contentArrowStyle={{ borderRight: '7px solid  #f17a7a' }}
    date="2020 June - present"
    iconStyle={{ background: '#f17a7a', color: '#fff' }}
    icon={<SchoolIcon />}
  >
    <h4 className="vertical-timeline-element-title">Graduated from</h4>
    <h5 className="vertical-timeline-element-subtitle">University of Waterloo</h5>
    <p>
      Bachelor of Appliced Science, Computer Engineering
    </p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--work"
    date="2019 Aug - 2020 Jan"
    iconStyle={{ background: '#f17a7a', color: '#fff' }}
    icon={<WorkIcon />}
  >
    <h4 className="vertical-timeline-element-title">Full Stack Developer</h4>
    <h5 className="vertical-timeline-element-subtitle">Aareas Interactive Inc.</h5>
    <p>Toronto, CA</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--work"
    date="2008 - 2010"
    iconStyle={{ background: '#f17a7a', color: '#fff' }}
    icon={<WorkIcon />}
    visible
  >
    <h3 className="vertical-timeline-element-title">
      [VISIBLE BY DEFAULT] Web Designer
    </h3>
    <h4 className="vertical-timeline-element-subtitle">Los Angeles, CA</h4>
    <p>User Experience, Visual Design</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--work"
    date="2006 - 2008"
    iconStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
    icon={<WorkIcon />}
  >
    <h3 className="vertical-timeline-element-title">Web Designer</h3>
    <h4 className="vertical-timeline-element-subtitle">San Francisco, CA</h4>
    <p>User Experience, Visual Design</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--education"
    contentStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
    contentArrowStyle={{ borderRight: '7px solid  rgb(233, 30, 99)' }}
    date="April 2013"
    iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
    icon={<SchoolIcon />}
    visible
  >
    <h3 className="vertical-timeline-element-title">
      [VISIBLE BY DEFAULT] Content Marketing for Web, Mobile and Social Media
    </h3>
    <h4 className="vertical-timeline-element-subtitle">Online Course</h4>
    <p>Strategy, Social Media</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--education"
    date="November 2012"
    iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
    icon={<SchoolIcon />}
  >
    <h3 className="vertical-timeline-element-title">
      Agile Development Scrum Master
    </h3>
    <h4 className="vertical-timeline-element-subtitle">Certification</h4>
    <p>Creative Direction, User Experience, Visual Design</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--education"
    date="2002 - 2006"
    iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
    icon={<SchoolIcon />}
    visible
  >
    <h3 className="vertical-timeline-element-title">
      [VISIBLE BY DEFAULT] Bachelor of Science in Interactive Digital Media
      Visual Imaging
    </h3>
    <h4 className="vertical-timeline-element-subtitle">Bachelor Degree</h4>
    <p>Creative Direction, Visual Design</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    className="vertical-timeline-element--education"
    date="2000 - 2002"
    iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
    icon={<SchoolIcon />}
    visible
  >
    <h3 className="vertical-timeline-element-title">
      [VISIBLE BY DEFAULT] Bachelor of Biology
    </h3>
    <h4 className="vertical-timeline-element-subtitle">Bachelor Degree</h4>
    <p>Creative Direction, Visual Design</p>
  </VerticalTimelineElement>,
  <VerticalTimelineElement
    iconStyle={{ background: 'rgb(16, 204, 82)', color: '#fff' }}
    icon={<StarIcon />}
  />,
];

  const Tree = () => {

    return(
      <VerticalTimeline>{defaultVisibleTimelineElements}</VerticalTimeline>

    );
  };

  
export default Tree;
